import React, { Component } from 'react';
import { Segment, Header, Button } from "semantic-ui-react";
import DataDisplay from "./components/pbDataDisplay";
import "./style.css";

class pbDataArea extends Component {

    render(){
        const { recieveData, currentData, saveLog, clearLog } = this.props;
        return (
            <Segment
                style={{
                    height: "100%",
                    marginTop: "0px",
                    marginLeft: "1em",
                    minWidth: "350px",
                    boxSizing: "border-box",
                }}
            >
                <Header as="h4">Data:</Header>
                <Segment>
                    <Header as="h5">Live Flight Data:</Header>
                    <pbDataDisplay currentData={currentData} />
                </Segment>
            </Segment>
        );
    }
}

export default pbDataArea;
